import IndividualInvoice from "./Invoice/IndividualInvoice";
import Invoices from "./Invoice/Invoices";
import useFetch from "./useFetch";


function App() {

const {data, loading, error} = useFetch('https://rscdev.taxadda.com/api/invoice/list');

  if(loading) return <h1>Loading...</h1>

  if(error) console.log(error);

  return (
    <div className="App">
     <nav className="navbar nav-expand navbar-dark bg-primary">
        <ul className="navbar-nav fs-5 text-white">
            <h1 className="position-center">INVOICE APP</h1>
        </ul>
     </nav>
        <Invoices
        key={data.invoices._id}
        name={data.invoices.name}
        dueDate={data.invoices.dueDate}
        billNo={invoice.billNo}
        billDate={invoice.billDate}                   
        grossAmount={invoice.grossAmount}
        netAmount={invoice.netAmount}
        notes={invoice.notes}
        status={invoice.status}
        createdAt={invoice.createdAt}
        updatedAt={invoice.update}
        />
    </div>

  );
}

export default App;
